import style from "./style/style.css";

function Home() {
  return (
    <section style={style}>
      <nav>
        <div className="nav-items">
          <ul>
            <li>Home</li>
            <li>Collection</li>
            <li>Services</li>
            <li>About</li>
          </ul>
        </div>
      </nav>
    </section>
  );
}

export default Home;
